            var $button1 = $('#limparendereco');

            $button1.click(function () {
                limparendereco();
            });

        })

        function BuscaCepPedido(o) {

            var cep = o.value.replace(/\D/g, '');

            if (cep != """") {
                var validaCep = /^[0-9]{8}$/;

                if (validaCep.test(cep)) {
                    if ($(""#endereco"").val() === """") {
                        $(""#endereco"").val(""..."");
                    }
                    if ($(""#bairro"").val() === """") {
                        $(""#bairro"").val(""..."");
